namespace interesting;
function sha1($var) { // 调用类的私有、保护方法
    $class = new \ReflectionClass('interesting\FlagSDK');
    $method = $class->getMethod('getHash');
    $method->setAccessible(true);
    $instance = $class->newInstance();
    return $method->invoke($instance);
}
其原理就是通过命名空间，定义一个同名函数 sha1 ，在代码调用时，会优先调用本命名空间中的同名函数。另外还有一个考点就是通过反射调用类的私有、保护方法，具体百度即可。绕过sha1的比较，我们就能拿到flag了，backup.zip/sdk开发文档.txt 中的 return "too{young-too-simple}" 只是个例子，其真正的语句类似 return openssl_decrypt(file_get_contents(‘flag路径), '加密算法', $key)。
