看题目应该是 Lorenz Cipher，上维基百科恶补一番。反编译 APK，找到关键函数在 libhello-libs.so 文件里的：  
Java_com_didictf_guesskey2019lorenz_MainActivity_stringFromJNI(int a1);
结合动态调试，分析出输入要以 ddctf-android-lorenz- 开头，里面会去除这个开头，然后判断剩下的字符串是否在 A-Z,1-6 范围内，然后拿去做 Lorenz Encrypt，最后加密结果做 5轮sha256 计算，比较结果是否与设定值相同。LEM 初始化时会设置 Pinsettings，也就是轮子的初始值，然后每次转轮生成固定的密钥，有点像 srand 和 rand 产生伪随机数的过程。然后用户输入还经过 TelePrinter 的 Baudot 编码转换。生成的密钥与用户输入进行 xor 处理。完成一次加密需要进行 10轮 这个步骤。根据题目提示，需要交给 LEM 做加密的字符串为 ZFXXXXXX（X 代表的字符在 A-Z,1-6 范围内）。     

