5.4.2. Have Fun

这题真令人头疼。变量名全部经过 Unicode混淆，字符串全部经过 动态解密混淆，关键代码还插了 垃圾指令 导致生成伪代码失败。

尝试动态调试，直接闪退，logcat 显示 loadlibrary 时抛出 has invalid shdr offset/size 错误。上网查了一下，发现 Android >= 7 时开启了诸多对 .so 文件的检测。而这道题的 .so 头部被修改过，所以过不了这个检测。先对 libhwFGfOp0EzktJb.so 进行分析。     

     此处会判断输入长度是否为14字节。     

     然后与 off_2910 进行比较。
off_2910 = @n|ixihPIppqws
再分析一下 smali 代码。发现它会调用到一个外部 dex 文件：assets/Y2xhc3Nlc19kZC5kZXg=。



这里会对用户输入进行 Encode，然后再交由 .so 进行比较。写解密脚本，发现提交答案始终不正确。在这里卡了一段时间，后来重新审计 smali 代码，发现自己还是太年轻了，没玩懂出题人的套路。里面有段代码会动态修改外部 dex 文件，往里面插入一些代码，重新计算头部的校验值，并且生成一个新的 dex 文件，释放到 /sdcard/ 里的一个隐藏文件夹里。新文件名为 dnsmanYUn12M.dex，这个才是真正被调用到的 dex 文件。没理解错的话，整个流程用术语好像是叫作 热修复？那么如何得到新的 dex 文件呢。搞了很久，终于找到一条行得通的办法。由于 .so 被修改了头，直接运行 APK 会闪退，所以注释掉 smali 里 loadlibrary 这一行，重新打包 APK，这样就能不会闪退了。然后点击 Check 的按钮，让它生成新的 dex 文件，并且由于没有 loadlibrary 无法调用外部函数，触发闪退。这样就能从隐藏文件夹里提取出新的 dnsmanYUn12M.vdex 和 dnsmanYUn12M.odex文件。然后手工转成 dnsmanYUn12M.dex 文件，进一步分析。     

     这才是真正的 dex 文件。套路真的深～写解密脚本，一个很简单的解密流程。  
enc='@n|ixihPIppqws'

flag=''
for i in range(len(enc)):
    flag+=chr(ord(enc[i])^(i+8))
print flag
